import React from "react";

const Tweet = ({ auther, post }) => {
  const click = (e) => {
    console.log(
      `I am deleting ${e.target.parentElement.children[0].innerText}`
    );
  };
  return (
    <div>
      <h2>My name is {auther}</h2>
      <h3>{post}</h3>
      <button onClick={click}>Delete</button>
      <button>Like</button>
    </div>
  );
};

export default Tweet;
